import React from 'react';
import './App.css';
import routes from './routes';
import PrivateRoutes from './routes/privateRoutes';

function App () {
    return (
        <div className="App">
            { routes.map(route => {
                if (route.requireAuth) {
                    <PrivateRoutes path={ route.path } component={ route.component }/>;
                }
            }) }
        </div>
    );
}

export default App;
